import React, {Fragment} from 'react';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import Gallerys from './components/Gallery/Gallerys';
import Hero from './components/Hero/Hero';

function App() {
  return (
    <Fragment>
      <Navbar />
      <Hero/>
      <Gallerys />
    </Fragment>
  );
}

export default App;
